import React from 'react';
import { Carousel } from 'antd';
import logo from '../../assets/images/Logo 1.svg'; // Double-check the import statement

const contentStyle = {
    height: '160px',
    color: '#fff',
    lineHeight: '160px',
    textAlign: 'center',
    background: '#364d79',
};

const SliderLogo = () => (
    <Carousel autoplay>
        <div className='flex bg-slate-600'>
            <div>
                <h3 style={contentStyle}>
                    <img src={logo} alt="" />
                </h3>
            </div>
            {/* Additional slides... */}
        </div>
    </Carousel>
);

export default SliderLogo;
